import React from 'react'
import { CardImg, Container } from 'react-bootstrap'
import AppNavBar from '../layouts/AppNavbar'
import logo from "./../img/freely-logo-final.png"
export default function Download() {
	return (
		<div>
			<AppNavBar/>
			<Container>
		<div style={{
			alignSelf:"center",
				justifySelf:"center",
		}}>
		<CardImg
			alt="Card image cap"
			bottom
			src={logo}
			style={{
				border:"1px solid red",
				width:"40%",
				display:"flex",
				alignSelf:"center",
				justifySelf:"center",
				marginTop:120,
				textAlign:"center"

			}}
			/>
		</div>

				</Container>
		</div>
	)
}
